import React from "react";
import header_img from "../assets/Header.png";

const Header = () => {
  return (
    <div>
      <img src={header_img} className="muthu_image" alt="logo" />
      <a href="tel:7904688429">
        <i className="anticon anticon-mobile" />
        7904688429
      </a>
    </div>
  );
};

export default Header;
